import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
  return (

    <nav>
      <ul className="space-y-2"> {/* Adds gap between list items */}
        <li>
          <NavLink
            to="/"
            className={({ isActive }) =>
              `block py-2 px-4 ${isActive ? 'text-[#6941C6]' : 'hover:bg-gray-300'
              }`
            }
          >
            Overview
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/page1"
            className={({ isActive }) =>
              `block py-2 px-4 ${isActive ? 'text-[#6941C6]' : 'hover:bg-gray-300'
              }`
            }
          >
            People Directory
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Sidebar;
